import React from "react";
import "./Homepage.css"

class Box extends React.Component {
    render() {
        return (
            <div id="main">
                <div id="images"></div>
                <div id="about">
                    <div className="head">
                        ABOUT
                    </div>
                </div>
                <div id="notice">
                    <div className="head">
                        NOTICE
                    </div>
                </div>
            </div>
        )
    }
}

export default Box;
